import React from "react";
import './HomePage.css';
import Banner from './Banner';
import AboutSection from './AboutSection';
import ExclusiveRights from "./ExclusiveRights";
import ContactSection from "./ContactSection";
import OurPartners from "./OurPartners";
import CountdownTimer from "./CountdownTimer";
import OpportunitiesSection from "./OpportunitiesSection";
const Homepage = () => {
  return (
    <div className="homepage">
      <main className="main-content">
        <Banner />
        <AboutSection />
        <ExclusiveRights />
        <OpportunitiesSection />
        <CountdownTimer />
        
        <OurPartners />
        <ContactSection />
        {/* <section id="about">
          <h2>About Us</h2>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer nec odio. Praesent libero.</p>
        </section> */}

        <section id="services">
          <h2>Services</h2>
          <p>Sed nisi. Nulla quis sem at nibh elementum imperdiet. Duis sagittis ipsum.</p>
        </section>

        <section id="portfolio">
          <h2>Portfolio</h2>
          <p>Here you can add images or showcase your projects.</p>
        </section>

        <section id="contact">
          <h2>Contact</h2>
          <p>Get in touch with us via email or phone.</p>
        </section>
      </main>
    </div>
  );
};

export default Homepage;
